import React from 'react';
import VideoList from './videolist';
const axios = require('axios');




export default class leftPanel extends React.Component{

    constructor(props) {
        super(props);
        this.state = {
          user: this.props.user,
          data: [],
        }
      }

      getLibraryContent() {
        var data = {};
        var libraryURL = 'http://localhost:2999/data';
        console.log(this.state.user);
        axios.get(libraryURL, {
            params: {
                user: this.state.user,
            }
        })
        .then( function (response) {  //Problem here
            data = response.data;
            console.log(data);
            for (let i = 0; i < response.data.videos.length; i++) {
                data.videos.push({
                    videoId: response.data.items[i].id.videoId, 
                    videotitle: response.data.items[i].snippet.title,
                    thumbnails: response.data.items[i].snippet.thumbnails
                });                      
            }
            console.log("Data got : "+data);
            return data;
        })
        .catch((err) => {
            console.log(err);
        })
    }

    componentDidMount(){
        this.setState({data: this.getLibraryContent()});
    }
    

    render(){
        
        console.log(this.state.data);

        return (

            <VideoList width='33.33%' user={this.state.user}/>


    );
    }

};
